<!DOCTYPE html>
<html>
<head>
<meta charset="utf-8"/>
<meta http-equiv="X-UA-Compatible" content="IE=edge"/>
<meta name="viewport" content="width=device-width, initial-scale=1.0">
<title>index</title>
<link rel="stylesheet" type="text/css" id="applicationStylesheet" href="index.css"/>
<script id="applicationScript" type="text/javascript" src="index.js"></script>
</head>
<body>
<div id="index">
	<img id="background" src="background.png" srcset="background.png 1x, background@2x.png 2x">
		
	<div id="MainContent">
		<svg class="background_i">
			<rect id="background_i" rx="0" ry="0" x="0" y="0" width="1602.89" height="716">
			</rect>
		</svg>
		<div id="AboutmeButton" class="AboutmeButton">
			<svg class="About">
				<rect id="About" rx="8" ry="8" x="0" y="0" width="360.465" height="100">
				</rect>
			</svg>
			<div id="About_me">
				<span>About me</span>
			</div>
		</div>
		<div id="CGButton" class="CGButton">
			<svg class="CG">
				<rect id="CG" rx="8" ry="8" x="0" y="0" width="360.226" height="100">
				</rect>
			</svg>
			<div id="Computer_Graphics">
				<span>Computer Graphics</span>
			</div>
		</div>
		<div id="ProgrammingButton" class="ProgrammingButton">
			<svg class="Programming">
				<rect id="Programming" rx="8" ry="8" x="0" y="0" width="360.226" height="100">
				</rect>
			</svg>
			<div id="Programming_r">
				<span>Programming</span>
			</div>
		</div>
		<img id="logo" src="logo.png" srcset="logo.png 1x, logo@2x.png 2x">
			
	</div>
	<div id="Header" class="Header">
		<svg class="HeaderBackground">
			<rect id="HeaderBackground" rx="0" ry="0" x="0" y="0" width="1799.845" height="100">
			</rect>
		</svg>
		<div id="Programming_Header">
			<svg class="Programming_w">
				<rect id="Programming_w" rx="8" ry="8" x="0" y="0" width="359.226" height="70">
				</rect>
			</svg>
			<div id="Programming_x">
				<span>Programming</span>
			</div>
		</div>
		<div id="CG_Header">
			<svg class="CG_z">
				<rect id="CG_z" rx="8" ry="8" x="0" y="0" width="359.226" height="70">
				</rect>
			</svg>
			<div id="Computer_Graphics_">
				<span>Computer Graphics</span>
			</div>
		</div>
		<div id="Aboutme_Header">
			<svg class="About_">
				<rect id="About_" rx="8" ry="8" x="0" y="0" width="359.226" height="70">
				</rect>
			</svg>
			<div id="About_me_">
				<span>About me</span>
			</div>
		</div>
		<img id="Top_Header" src="Top_Header.png" srcset="Top_Header.png 1x, Top_Header@2x.png 2x">
			
	</div>
</div>
</body>
</html>
